THE KNITTER is a creative british knitting magazine. My favourite.

You will find in this post all the issues from 1 (January 2009) to 70 (April 2014)
If you enjoy, you may buy lattest issues from the web site : http://www.myfavouritemagazines.co.uk/content/lp/digitalbundles/cl-theknitter/

Thanks to all of you around the word who share books, magazines, tips and friendship.

